settings.cellContentFunction:
let formated = "";
let ms = (value / 60000).toFixed(0);
let days = (ms - ms % 1440) / 1440;
let hours = (ms % 1440 - ms % 60) / 60;
let minutes = ms % 60;
if (days) formated += days + 'Day(s), ';
if (hours) formated += hours + 'Hr:';
formated += minutes + 'Min';
return formated;

multipleSelectedAction.customFunction:
let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap
    .get('customDialog'));
let entityService = $injector.get(widgetContext.servicesMap
    .get('entityService'));
let assetService = $injector.get(widgetContext.servicesMap
    .get('assetService'));
let deviceService = $injector.get(widgetContext.servicesMap
    .get('deviceService'));
let attributeService = $injector.get(widgetContext
    .servicesMap.get('attributeService'));
let entityRelationService = $injector.get(widgetContext
    .servicesMap.get('entityRelationService'));
let parentAsset = widgetContext.stateController
    .getStateParams().selected_sub_asset;
if (parentAsset) openEditEntityDialog();

function openEditEntityDialog() {
    customDialog.customDialog(htmlTemplate,
        EditEntityDialogController).subscribe();
}

function EditEntityDialogController(instance) {
    let vm = instance;
    vm.editEntityFormGroup = vm.fb.group({
        parentAsset: [parentAsset.entityId, [vm
            .validators.required
        ]],
    });
    assetService.getAsset(parentAsset.entityId.id)
        .subscribe(resp => {
            vm.assetName = resp.label || resp.name;
        });

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    vm.save = function() {
        vm.editEntityFormGroup.markAsPristine();
        let devicesIds = additionalParams.alarms.map(
            alarm => {
                return {
                    originatorName: alarm
                        .originatorName,
                    originatorType: alarm.details
                        .originatorType
                };
            });
        attributeService.saveEntityAttributes(
            parentAsset.entityId, "SERVER_SCOPE", [{
                key: 'devicesIds',
                value: JSON.stringify(
                    devicesIds)
            }]).subscribe(function() {
            widgetContext.$scope
                .alarmsDatasource.selected = [];
            let aliases = [];
            if (widgetContext.datasources &&
                widgetContext.datasources.length
                ) {
                let aliasName = widgetContext
                    .datasources[0].aliasName;
                for (const [key, value] of
                    Object.entries(widgetContext
                        .dashboard
                        .aliasController
                        .entityAliases)) {
                    if (value.alias ===
                        aliasName) {
                        aliases.push(key);
                    }
                }
                widgetContext.updateAliases(
                    aliases);
            }
            for (const [key, value] of Object
                .entries(widgetContext.dashboard
                    .aliasController
                    .entityAliases)) {
                if (value.alias ===
                    "Selected Asset Devices") {
                    setTimeout(function() {
                        widgetContext
                            .updateAliases(
                                [value
                                    .id
                                ])
                    }, 2000);
                }
            }
            vm.dialogRef.close(null);
        });

    };

}

