function openAddEntityDialog() {
    customDialog.customDialog(htmlTemplate, AddEntityDialogController).subscribe();
}

function AddEntityDialogController(instance) {
    let vm = instance;
    vm.dataLoaded = false;
    vm.alarmStatuses = {
        ACTIVE_UNACK: "alarm.display-status.ACTIVE_UNACK",
        ACTIVE_ACK: "alarm.display-status.ACTIVE_ACK",
        CLEARED_UNACK: "alarm.display-status.CLEARED_UNACK",
        CLEARED_ACK: "alarm.display-status.CLEARED_ACK",
    }

    vm.alarmFormGroup = vm.fb.group({
        comentary: [null],
        createdTime: [null],
        originatorName: [null],
        parentName: [null],
        startTime: [null],
        endTime: [null],
        ackTime: [null],
        clearTime: [null],
        type: [null],
        severity: [null],
        translatedStatus: [null],
        status: [null],
        acknowledge_notes: [null],
        clear_notes: [null],
        details: [null]
    });

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    function getAlarmInfo() {
        widgetContext.http.get("/api/alarm/info/"+additionalParams.alarm.id.id).subscribe(resp=>{
            vm.alarm = resp;
            console.log(resp);
            if (resp && resp.details && resp.details['1stLevelAssetLabel']) {
                resp.parentName = resp.details['1stLevelAssetLabel'];
            }
            if (resp && resp.details && resp.details['acknowledge_notes']) {
                resp.acknowledge_notes = resp.details['acknowledge_notes'];
            }
            if (resp && resp.details && resp.details['clear_notes']) {
                resp.clear_notes = resp.details['clear_notes'];
            }
            resp.translatedStatus = widgetContext.translate.instant(vm.alarmStatuses[resp.status])
            vm.alarmFormGroup.patchValue(resp);
            vm.dataLoaded = true;
            widgetContext.detectChanges(true);
        });
    }
    getAlarmInfo();

    vm.save = function(type) {
        vm.alarm.details[type+"_notes"] = vm.alarmFormGroup.get('comentary').value;
        widgetContext.http.post('/api/alarm',vm.alarm).subscribe(resp=>{
            if (type === "clear") {
                widgetContext.http.post('/api/alarm/'+vm.alarm.id.id+'/clear').subscribe(resp=>{
                    widgetContext.updateAliases();
                    vm.dialogRef.close(null);
                });
            } else if (type == "acknowledge") {
                widgetContext.http.post('/api/alarm/'+vm.alarm.id.id+'/ack').subscribe(resp=>{
                    widgetContext.updateAliases();
                    vm.dialogRef.close(null);
                });
            } else {
                vm.dialogRef.close(null);
            }
        });
    };
}

