headerButton.customFunction:
let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));
let assetService = $injector.get(widgetContext.servicesMap.get('assetService'));
let attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));
let entityRelationService = $injector.get(widgetContext.servicesMap.get('entityRelationService'));
let selectedParent = widgetContext.stateController.getStateParams().selected_asset;
if (selectedParent)openAddEntityDialog();

function openAddEntityDialog() {
    customDialog.customDialog(htmlTemplate, AddEntityDialogController).subscribe();
}

function AddEntityDialogController(instance) {
    let vm = instance;

    vm.allowedEntityTypes = ['ASSET'];
    vm.categoryStorageAsset;
    vm.categoryStorageArray = [];
    vm.typeStorageArray = [];
    vm.hasMaxOccupancyLimit = false;
    let assetCategoriesWithOccupancyLimit = ['Classroom', 'Room', 'Lab', 'Office', 'Flex Classroom'];
    vm.addEntityFormGroup = vm.fb.group({
            entityName: ['', [vm.validators.required]],
            entityType: ['ASSET'],
            id: [{}],
            entityLabel: [''],
            type: ['', [vm.validators.required]],
            alarmProfile: [null],
            attributes: vm.fb.group({
                assetCategory: ['', [vm.validators.required]],
                enableAlarm: [null],
                xPos: [null],
                yPos: [null],
                maxOccupancyLimit: [null],
                alarmProfile: [null],
                imgPlan: [null],
                existingAttributes: vm.fb.array([]),
                clearAttributeAfterAlarmClear: vm.fb.array([]),
                settings: vm.fb.group({
                    enableReminder: [false],
                    notifications_interaval: [900]
                })
                // imgPlan: [null]
            })
        });
        vm.getAttrArray = function () {
        return vm.addEntityFormGroup.get("attributes.existingAttributes");
    };
    vm.addIndividualAttr = function (el) {
        vm.getAttrArray().push(vm.fb.group({
            keyName: [el? el.keyName : null , [vm.validators.required]],
            keyValue: [el? el.keyValue : null, [vm.validators.required]]
        }));
    };
    vm.removeIndividualAttr = function (index) {
        vm.getAttrArray().removeAt(index);
    };
        vm.addEntityFormGroup.get("alarmProfile").valueChanges.subscribe(alarmProfile=>{
            if  (alarmProfile) {
                let id = {
                    entityType: "ASSET",
                    id: alarmProfile
                }
                assetService.getAsset(alarmProfile).subscribe(resp=>{
                    if (resp) vm.addEntityFormGroup.get("attributes.alarmProfile").setValue(resp.name);
                })
                let attrKeys= ["alarmConfig"];
                attributeService.getEntityAttributes(id, "SERVER_SCOPE", attrKeys).subscribe(resp=>{
                    if(resp &&resp.length) {
                        let alarms = resp[0].value.alarms;
                        let attributes = [];
                        alarms.forEach(alarm=>{
                            alarm.createAlarmRules.forEach(alarmRule=>{
                                alarmRule.alarmRule.condition.condition.forEach(condition=>{
                                if (condition.key.type === "ATTRIBUTE" || condition.key.type === "TIME_SERIES") {
                                    condition.predicate.forEach(predicate=>{
                                        attributes = attributes.concat(retunrAttribues(predicate));
                                    });
                                }
                            });
                            });

                        });
                        if (attributes.length) {
                            const uniqueSet = new Set(attributes);
                            attributes = [...uniqueSet];
                        }
                        addAlarmProfileControls(attributes);
                    }
                });

            }
        });

        vm.getClearConditionArray = function() {
            return vm.addEntityFormGroup.get('attributes.clearAttributeAfterAlarmClear');
        }
        vm.addClearCondition = function() {

            vm.getClearConditionArray().push(
                vm.fb.group({
                    dataKeyName: ['', [vm.validators.required]],
                    alarmType: [''],
                    isAttribute: [true]
                }));
                widgetContext.detectChanges();
        };

        vm.removeClearCondition = function($index) {
            vm.addEntityFormGroup.get('attributes.clearAttributeAfterAlarmClear').removeAt($index);
        };

        function  addAlarmProfileControls (attributes) {
            let attrFG = vm.addEntityFormGroup.get("attributes");
            vm.showAttributes = false;
            if (vm.oldAttributes && vm.oldAttributes.length) {
                vm.oldAttributes.forEach(oldAttr=>{
                    attrFG.removeControl(oldAttr);
                });
            } 
            // if (attributes.length) {
            //     attributes.forEach(attr=>{
            //         attrFG.addControl(attr, vm.fb.control(null));
            //         // attributeService.getEntityAttributes(entityId, "SERVER_SCOPE", [attr]).subscribe(resp=>{
            //         //     if (resp && resp.length) {
            //         //       attrFG.get(attr).setValue(resp[0].value); 
            //         //     }
            //         // });
            //     });
            // }
            vm.oldAttributes = attributes;
            vm.showAttributes = true;
        }

        function retunrAttribues (predicate) {
            let attributes = [];
            if (predicate.type !== "COMPLEX") {
                if (predicate.value.dynamicMode) {
                    attributes.push(predicate.value.dynamicValue.sourceAttribute);
                }
            } else {
                predicate.predicates.forEach(predicate=>{
                   attributes = attributes.concat(retunrAttribues(predicate));
                });

            }
            return attributes;
        }


    function returnPageLink (textSearch, pageSize, page, sortOrder) {
        let pageLink = {
            textSearch: textSearch || null,
            pageSize: pageSize || 10,
            page: page || 0,
            sortOrder: sortOrder || null,
            toQuery : function() {
            let query = `?pageSize=${pageLink.pageSize}&page=${pageLink.page}`;
            if (pageLink.textSearch && pageLink.textSearch.length) {
                query += `&textSearch=${pageLink.textSearch}`;
            }
            if (pageLink.sortOrder) {
                query += `&sortProperty=${pageLink.sortOrder.property}&sortOrder=${pageLink.sortOrder.direction}`;
            }
            return query;
        }
        };
        return pageLink;
    }

    getAssetTypes();
    getAssetCategoryAsset();

    vm.displayFn = function (category) {
        return category ? category : '';
    };

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    vm.save = function() {
        vm.addEntityFormGroup.markAsPristine();
        saveEntityObservable().subscribe(
            function (entity) {
                widgetContext.rxjs.forkJoin([
                    saveAttributes(entity.id),
                    updateRelation(entity.id)
                ]).subscribe(
                    function () {
                        let aliases = [];
                        if(widgetContext.datasources && widgetContext.datasources.length) {
                            let aliasName = widgetContext.datasources[0].aliasName;
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                                if (value.alias === aliasName) {
                                    aliases.push(key);
                                }
                            }
                            widgetContext.updateAliases(aliases);
                        } else {
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                            if (value.alias === "Selected Hierarchy Assets") {
                                widgetContext.updateAliases([value.id]);
                            }
                        }
                        }
                        vm.dialogRef.close(null);
                    }
                );
            }
        );
    };
    function updateRelation(id) {
        if (vm.prevRelation && vm.prevRelation.id !== vm.addEntityFormGroup.get("alarmProfile").value && vm.addEntityFormGroup.get("alarmProfile").value) {
             return widgetContext.rxjs.forkJoin([entityRelationService.deleteRelation(id, "alarmProfile", vm.prevRelation), entityRelationService.saveRelation({
                type: "alarmProfile",
                typeGroup: "COMMON",
                to: id,
                from: {
                    entityType: "ASSET",
                    id: vm.addEntityFormGroup.get("alarmProfile").value
                }
            })]) 

        } else {
            return widgetContext.rxjs.forkJoin(vm.addEntityFormGroup.get("alarmProfile").value ? [entityRelationService.saveRelation({
                type: "alarmProfile",
                typeGroup: "COMMON",
                to: id,
                from: {
                    entityType: "ASSET",
                    id: vm.addEntityFormGroup.get("alarmProfile").value
                }
            }), entityRelationService.saveRelation({
                type: "Contains",
                typeGroup: "COMMON",
                to: id,
                from: selectedParent.entityId
            })]:[ entityRelationService.saveRelation({
                type: "Contains",
                typeGroup: "COMMON",
                to: id,
                from: selectedParent.entityId
            })]);
        }
    }

    function saveEntityObservable() {
        const formValues = vm.addEntityFormGroup.value;
        let entity = {
            name: formValues.entityName,
            type: formValues.type,
            label: formValues.entityLabel
        };
        if (vm.categoryStorageArray.indexOf(formValues.attributes.assetCategory) === -1) {
            vm.categoryStorageArray.push(formValues.attributes.assetCategory);
            attributeService.saveEntityAttributes(vm.categoryStorageAsset.id, "SERVER_SCOPE", [{key: "assetCategories", value: vm.categoryStorageArray.join(',')}]).subscribe();
        }
        if (formValues.entityType == 'ASSET') {
            return assetService.saveAsset(entity);
        } else if (formValues.entityType == 'DEVICE') {
            return deviceService.saveDevice(entity);
        }
    }

    function saveRelations(entityId) {
        let relations = vm.addEntityFormGroup.get('relations').value;
        let tasks = [];

        for(let i=0; i < relations.length; i++) {
            let relation = {
                type: relations[i].relationType,
                typeGroup: 'COMMON'
            };
            if (relations[i].direction == 'FROM') {
                relation.to = relations[i].relatedEntity;
                relation.from = entityId;
            } else {
                relation.to = entityId;
                relation.from = relations[i].relatedEntity;
            }
            tasks.push(entityRelationService.saveRelation(relation));
        }
        if (tasks.length > 0) {
            return widgetContext.rxjs.forkJoin(tasks);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }

    function saveAttributes(entityId) {
        let attributes = vm.addEntityFormGroup.get('attributes').value;
        let attributesArray = [];
        for (let key in attributes) {
            if(attributes[key] !== null) {
                if (key === "existingAttributes") {
                    attributes[key].forEach(attr=>{
                    attributesArray.push({key: attr.keyName, value: attr.keyValue});    
                    })

                } else {
                    attributesArray.push({key: key, value: attributes[key]});
                }
            }
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }

    vm.filter = function (value) {
        return value.toLowerCase().indexOf(addEntityFormGroup.controls.attributes.controls.assetCategory.value.toLowerCase()) === 0;
    };


    vm.typeFilterArray = function () {
            let assetTypeValue = vm.addEntityFormGroup.controls.type.value;
            let newArray = [];
            if (vm.typeStorageArray && vm.typeStorageArray.length) newArray = vm.typeStorageArray.filter(value=>value.toLowerCase().indexOf(assetTypeValue.toLowerCase()) === 0);
            if (assetTypeValue.length && (vm.typeStorageArray[0] && vm.typeStorageArray[0].toLowerCase() !== assetTypeValue.toLowerCase())) {
                newArray.push(assetTypeValue);
            }
            return newArray;
        };
    function getAssetTypes () {
            assetService.getAssetTypes().subscribe(data=>{
                vm.typeStorageArray = data.map(subType => subType.type).filter(subType=>!subType.toLowerCase().startsWith("hierarchy"));
            })
        }

    vm.categoryFilterArray = function () {
        let assetCategoryValue = vm.addEntityFormGroup.controls.attributes.controls.assetCategory.value;
        if (assetCategoriesWithOccupancyLimit.indexOf(assetCategoryValue) > -1) {
            vm.hasMaxOccupancyLimit = true;
        } else {
            vm.hasMaxOccupancyLimit = false;
        }
        let newArray = [];
        if (vm.categoryStorageArray && vm.categoryStorageArray.length) newArray = vm.categoryStorageArray.filter(value=>value.toLowerCase().indexOf(assetCategoryValue.toLowerCase()) === 0);
        if (assetCategoryValue.length && (vm.categoryStorageArray[0] && vm.categoryStorageArray[0].toLowerCase() !== assetCategoryValue.toLowerCase())) {
            newArray.push(assetCategoryValue);
        }
        return newArray;
    };

    function getAssetCategoryAsset () {
        assetService.getUserAssets(returnPageLink("Asset Categories storage")).subscribe(data=>{
            if (data && data.data && data.data.length) {
                vm.categoryStorageAsset = data.data[0];
                attributeService.getEntityAttributes(vm.categoryStorageAsset.id, "SERVER_SCOPE", ["	assetCategories"], {}).subscribe(attrData=>{
                    if (attrData && attrData.length) {
                        vm.categoryStorageArray = attrData[0].value.split(',');
                    }
                });
            }
        });
    }
}

