    function parseCSV(importData) {
        var config = {
            delim: ',',
            header:true
        };
        return convertCSVToJson(importData, config);
    }

    function isNumeric(str) {
        str = str.replace(',', '.');
        return !isNaN(parseFloat(str)) && isFinite(str);
    }

    function convertCSVToJson(csvdata, config) {
        config = config || {};
        const delim = config.delim || ",";
        const header = config.header || false;
        let result = {};

        let csvlines = csvdata.split(/[\r\n]+/);
        let csvheaders = splitCSV(csvlines[0], delim);
        if (csvheaders.length < 2) {
            console.error(widgetContext.translate.instant('import.import-csv-number-columns-error'));
            return -1;
        }
        let csvrows = header ? csvlines.slice(1, csvlines.length) : csvlines;

        result.headers = csvheaders;
        result.rows = [];

        for (let r in csvrows) {
            if (Object.prototype.hasOwnProperty.call(csvrows, r)) {
                let row = csvrows[r];

                if (row.length === 0)
                    break;

                let rowitems = splitCSV(row, delim);
                if (rowitems.length !== result.headers.length) {
                    console.error(widgetContext.translate.instant('import.import-csv-invalid-format-error', {line: (header ? result.rows.length + 2: result.rows.length + 1)}));
                    return -1;
                }
                for (let i = 0; i < rowitems.length; i++) {
                    rowitems[i] = convertStringToJSType(rowitems[i]);
                }
                result.rows.push(rowitems);
            }
        }
        return result;
    }

    function convertStringToJSType(str) {
        if (isNumeric(str.replace(',', '.'))) {
            return parseFloat(str.replace(',', '.'));
        }
        if (str.search(/^(true|false)$/im) === 0) {
            return str === 'true';
        }
        if (str === "") {
            return null;
        }
        return str;
    }

    function splitCSV(str, sep) {
        for (var foo = str.split(sep = sep || ","), x = foo.length - 1, tl; x >= 0; x--) {
            if (foo[x].replace(/"\s+$/, '"').charAt(foo[x].length - 1) == '"') {
                if ((tl = foo[x].replace(/^\s+"/, '"')).length > 1 && tl.charAt(0) == '"') {
                    foo[x] = foo[x].replace(/^\s*"|"\s*$/g, '').replace(/""/g, '"');
                } else if (x) {
                    foo.splice(x - 1, 2, [foo[x - 1], foo[x]].join(sep));
                } else foo = foo.shift().split(sep).concat(foo);
            } else foo[x].replace(/""/g, '"');
        }
        return foo;
    }

    function saveEntity(asset) {
        var entity = {
            name: asset.entityName,
            label: asset.entityLabel,
            type: asset.entityType, 
        };
        return assetService.saveAsset(entity);
    }

    function saveAttributes(entityId, asset) {
        let attributesArray = [];
        for (const [key, value] of Object.entries(asset)) {
            switch (key) {
                case 'entityLabel':
                case 'entityName':
                case 'entityType':
                case 'id':
                case 'status':
                case 'alarmProfile':
                case 'connectedDevices':
                break;
                default:
                attributesArray.push({key: key, value: value});
            }
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }

    function saveRelation(entityId, asset) {
        let relations = vm.relations;
        if (asset.alarmProfile && asset.alarmProfile.length) {
            assetService.getUserAssets(returnPageLink(asset.alarmProfile)).subscribe(alarmProfiles=>{
                let alarmProfile = alarmProfiles.data.find(ap=>ap.name === asset.alarmProfile);
                if (alarmProfile) {
                    entityRelationService.saveRelation({
                        type: "alarmProfile",
                        typeGroup: 'COMMON',
                        to: entityId,
                        from: alarmProfile.id
                    }).subscribe(resp=>{
                        attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", [{key: "alarmProfile", value: asset.alarmProfile}]).subscribe(()=>{});
                    })
                }
            })
        }
        if (vm.connectedDevices && vm.connectedDevices.length) {
            vm.connectedDevices.forEach(deviceName=>{
                deviceService.findByName(deviceName, {ignoreErrors: true}).subscribe(device=>{
                 let relation = {
                    type: 'Contains',
                    typeGroup: 'COMMON',
                    from: asset.id,
                    to: device.id
                }
                entityRelationService.saveRelation(relation, {ignoreErrors: true}).subscribe(()=>{})
                })

            })
        }
        let tasks = [];
        for(let i=0; i < relations.length; i++) {
            let relation = {
                type: relations[i].relationType,
                typeGroup: 'COMMON'
            };
            if (relations[i].direction == 'FROM') {
                relation.to = relations[i].relatedEntity;
                relation.from = entityId;
            } else {
                relation.to = entityId;
                relation.from = relations[i].relatedEntity;
            }
            tasks.push(entityRelationService.saveRelation(relation, asset));
        }
        if (tasks.length > 0) {
            return widgetContext.rxjs.forkJoin(tasks);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }
}

