            assetService.getAssetTypes().subscribe(data=>{
                vm.typeStorageArray = data.map(subType => subType.type).filter(subType=>!subType.toLowerCase().startsWith("hierarchy"));
            })
        }

    vm.categoryFilterArray = function () {
        let assetCategoryValue = vm.addEntityFormGroup.controls.attributes.controls.assetCategory.value;
        if (assetCategoriesWithOccupancyLimit.indexOf(assetCategoryValue) > -1) {
            vm.hasMaxOccupancyLimit = true;
        } else {
            vm.hasMaxOccupancyLimit = false;
        }
        let newArray = [];
        if (vm.categoryStorageArray && vm.categoryStorageArray.length) newArray = vm.categoryStorageArray.filter(value=>value.toLowerCase().indexOf(assetCategoryValue.toLowerCase()) === 0);
        if (assetCategoryValue.length && (vm.categoryStorageArray[0] && vm.categoryStorageArray[0].toLowerCase() !== assetCategoryValue.toLowerCase())) {
            newArray.push(assetCategoryValue);
        }
        return newArray;
    };

    function getAssetCategoryAsset () {
        assetService.getUserAssets(returnPageLink("Asset Categories storage")).subscribe(data=>{
            if (data && data.data && data.data.length) {
                vm.categoryStorageAsset = data.data[0];
                attributeService.getEntityAttributes(vm.categoryStorageAsset.id, "SERVER_SCOPE", ["assetCategories"], {}).subscribe(attrData=>{
