console.log(widgetContext);
openDeleteEntityDialog();

function openDeleteEntityDialog() {
    let title = 'Delete  Digital Twin ' +
        entityName;
    let content = 'Are you sure you want to delete the Digital Twin ' +
        entityName + '?';
    let contentRelation =
        "Digital Twin " + entityName + " can't be removed as it has relations.";
    entityRelationService.findByFrom(entityId).subscribe(resp => {
        if (resp && resp.length > 0) {
            dialogs.alert(title, contentRelation,
                "CLOSE").subscribe(
                function(result) {}
            );
        } else {
            dialogs.confirm(title, content,
                'Cancel', 'Delete').subscribe(
                function(result) {
                    if (result) {
                        removeEntityFromTheState();
                        deleteEntity();
                    }
                }
            );
        }
    });

}

function removeEntityFromTheState () {
    let params = widgetContext.stateController.getStateParams();
    delete params.selected_sub_asset;
    widgetContext.stateController.updateState("default", params);
}

function deleteEntity() {
    deleteEntityObservable(entityId).subscribe(
        function success() {
            let aliases = [];
                        if(widgetContext.datasources && widgetContext.datasources.length) {
                            let aliasName = widgetContext.datasources[0].aliasName;
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                                if (value.alias === aliasName) {
                                    aliases.push(key);
                                }
                            }
                            widgetContext.updateAliases(aliases);
                        }
        },
        function fail() {
            showErrorDialog();
        }
    );
}

function deleteEntityObservable(entityId) {
    if (entityId.entityType == "ASSET") {
        return assetService.deleteAsset(entityId.id);
    } 
}

function showErrorDialog() {
    let title = 'Error';
    let content =
        'An error occurred while deleting the Digital Twin. Please try again.';
    dialogs.alert(title, content, 'CLOSE')
}

