function openAddEntityDialog() {
    customDialog.customDialog(htmlTemplate, AddEntityDialogController).subscribe();
}

function AddEntityDialogController(instance) {
    let vm = instance;

let prefixArray = [];
    vm.allowedEntityTypes = ['ASSET', 'DEVICE'];
    vm.entitySearchDirection = {
        from: "FROM",
        to: "TO"
    };

    vm.addEntityFormGroup = vm.fb.group({
     entityName: ['', [vm.validators.required]],
     entityType: ['DEVICE'],
     entityLabel: [null],
     type: ['', [vm.validators.required]],
     attributes: vm.fb.group({
         useCase: [null, [vm.validators.required]],
         DeviceCategory: ['', [vm.validators.required]],
         inactivityTimeout: [null],
         openFlagValue: [null],
         utilizationTimeThreshold: [null],
         prefix: [null],
         openFlagName: [null],
         customAttributes: vm.fb.array([]),
         transformationMap: vm.fb.group({
                transformationType: ["individual", [vm.validators.required]],
                groupTransformation: "return incomingMsg;",
                individualMap: vm.fb.array([])
            })
     }),
     relations: vm.fb.array([])
    });

    function returnPageLink (textSearch, pageSize, page, sortOrder) {
        let pageLink = {
            textSearch: textSearch || null,
            pageSize: pageSize || 10,
            page: page || 0,
            sortOrder: sortOrder || null,
            toQuery : function() {
            let query = `?pageSize=${pageLink.pageSize}&page=${pageLink.page}`;
            if (pageLink.textSearch && pageLink.textSearch.length) {
                query += `&textSearch=${pageLink.textSearch}`;
            }
            if (pageLink.sortOrder) {
                query += `&sortProperty=${pageLink.sortOrder.property}&sortOrder=${pageLink.sortOrder.direction}`;
            }
            return query;
        }
        };
        return pageLink;
    }
    vm.attributes = {};

    vm.useCaseSelected = function (event) {
        // removeOldControls(vm.previousZone);
        vm.previousZone = vm.addEntityFormGroup.value.attributes.useCase;
        // vm.addEntityFormGroup.value.attributes.useCase.zones.forEach(zone=>{
        //   zone.fields.forEach(field=>{
        //       vm.addEntityFormGroup.controls.attributes.addControl(field.name, vm.fb.control(field.defaultValue));
        //   });
        // });
        vm.types = event.value.types;
    };

    // function removeOldControls (oldZone) {
    //     if (oldZone) {
    //         oldZone.zones.forEach(zone=>{
    //       zone.fields.forEach(field=>{
    //           vm.addEntityFormGroup.controls.attributes.removeControl(field.name);
    //       });
    //     });
    //     }
    // }

    function getConfiguration () {
        attributeService.getEntityAttributes(parentAsset.entityId, 'SERVER_SCOPE', ["customAttributes"]).subscribe(resp=>{
            if (resp && resp.length) {
                prefixArray = resp[0].value;
            }
        })
        vm.isLoading$ = true;
        assetService.getUserAssets(returnPageLink("Device type storage asset")).subscribe(data=>{
            if (data && data.data && data.data[0]) {
                attributeService.getEntityAttributes(data.data[0].id, "SERVER_SCOPE", ['zonedConfiguration']).subscribe(attr=>{
                    if (attr && attr[0]) vm.configurationList = attr[0].value;
                    vm.isLoading$ = false;
                });
            }
        });
    }

    getConfiguration();

    vm.getTransformationType = function () {
        return vm.addEntityFormGroup.get("attributes.transformationMap.transformationType").value;
    };
    vm.getIndividualMarArray = function () {
        return vm.addEntityFormGroup.get("attributes.transformationMap.individualMap");
    };
    vm.getAttrArray = function () {
        return vm.addEntityFormGroup.get("attributes.customAttributes");
    };
    vm.addIndividualMap = function (el) {
        vm.getIndividualMarArray().push(vm.fb.group({
            inputKeyName: [el? el.inputKeyName : null , [vm.validators.required]],
            outputKeyName: [el? el.outputKeyName : null, [vm.validators.required]],
            transformationFn: [el? el.transformationFn : "return incomingValue;", [vm.validators.required]]
        }));
    };
    vm.addIndividualAttr = function (el) {
        vm.getAttrArray().push(vm.fb.group({
            keyName: [el? el.keyName : null , [vm.validators.required]],
            keyValue: [el? el.keyValue : null, [vm.validators.required]]
        }));
    }
    vm.removeIndividualMap = function (index) {
        vm.getIndividualMarArray().removeAt(index);
    };
    vm.removeIndividualAttr = function (index) {
        vm.getAttrArray().removeAt(index);
    };
    function getEntityAttributes(attributes) {
        for (var i = 0; i < attributes.length; i++) {
            vm.attributes[attributes[i].key] = attributes[i].value;
        }
    }


    function getEntityInfo() {
        vm.loading = true;
        attributeService.getEntityAttributes(entityId, 'SERVER_SCOPE', ["transformationMap"]).subscribe(
            function (data) {
                getEntityAttributes(data);
                vm.loading = false;
                if (data && data.length) {
                    vm.addEntityFormGroup.get("attributes.transformationMap").patchValue({
                        transformationType: data[0].value.transformationType,
                        groupTransformation: data[0].value.groupTransformation
                    })
                    if (data[0].value.individualMap.length) {
                        data[0].value.individualMap.forEach(el=>{
                            vm.addIndividualMap(el);
                        })
                    }
                }
                // vm.addEntityFormGroup.patchValue({

                // }, {emitEvent: false});
            }
        );
    }

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    vm.relations = function() {
        return vm.addEntityFormGroup.get('relations');
    };

    vm.relations().push(vm.fb.group({
         relatedEntity: [parentAsset.entityId, [vm.validators.required]],
         relationType: ['Contains', [vm.validators.required]],
         direction: [vm.entitySearchDirection.to, [vm.validators.required]]
        }));


    vm.save = function() {
        vm.addEntityFormGroup.markAsPristine();
        if (vm.addEntityFormGroup.value.attributes.useCase.useCase === 'Utitlization Rate' || vm.addEntityFormGroup.value.attributes.useCase.useCase === 'Run Time') {
            vm.relations().push(vm.fb.group({
         relatedEntity: [parentAsset.entityId, [vm.validators.required]],
         relationType: ['Utility', [vm.validators.required]],
         direction: [vm.entitySearchDirection.to, [vm.validators.required]]
        }));
        }
        saveEntityObservable().subscribe(
            function (entity) {
                widgetContext.rxjs.forkJoin([
                    saveAttributes(entity.id),
                    saveAttributesParent(parentAsset.entityId),
                    saveRelations(entity.id)
                ]).subscribe(
                    function () {
                        let aliases = [];
                        if(widgetContext.datasources && widgetContext.datasources.length) {
                            let aliasName = widgetContext.datasources[0].aliasName;
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                                if (value.alias === aliasName) {
                                    aliases.push(key);
                                }
                            }
                            widgetContext.updateAliases(aliases);
                        } else {
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                            if (value.alias === "Selected Asset Devices") {
                                widgetContext.updateAliases([value.id]);
                            }
                        }
                        }
                        vm.dialogRef.close(null);
                    }
                );
            }
        );
    };

    function saveEntityObservable() {
        const formValues = vm.addEntityFormGroup.value;
        let entity = {
            name: formValues.entityName,
            type: formValues.type,
            label: formValues.entityLabel
        };
        if (formValues.entityType == 'ASSET') {
            return assetService.saveAsset(entity);
        } else if (formValues.entityType == 'DEVICE') {
            return deviceService.saveDevice(entity);
        }
    }

    function saveAttributesParent(entityId) {
        let attributes = vm.addEntityFormGroup.get('attributes').value;
        let attributesArray = [];
        let settingsAttr = {
            key: "settings",
            value: {}
        };

        const prefix = attributes.prefix;
        for (let key in attributes) {
            if(attributes[key] !== null) {
                if (key == "customAttributes") {
                    value: attributes[key].forEach(attr=>{

                        if (prefixArray.indexOf(prefix+"_"+attr.keyName) === -1) {
                            prefixArray.push(prefix+"_"+attr.keyName);
                        }
                        console.log(prefixArray)
                       attributesArray.push({key: (prefix+"_"+attr.keyName), value: attr.keyValue});
                    })
                    if (prefixArray.length) attributesArray.push({key: "customAttributes", value: prefixArray})

                }
            }
        }
        settingsAttr.value = JSON.stringify(settingsAttr.value);
        attributesArray.push(settingsAttr);
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }

    function saveAttributes(entityId) {
        let attributes = vm.addEntityFormGroup.get('attributes').value;
        let attributesArray = [];
        let settingsAttr = {
            key: "settings",
            value: {}
        };
        for (let key in attributes) {
            if(attributes[key] !== null) {
                if (key == "DeviceCategory" || key == "inactivityTimeout" || key == "transformationMap" || key == "openFlagValue" || key == "utilizationTimeThreshold" || key == "openFlagName" || key == "prefix" || key == "customAttributes") {
                    attributesArray.push({key: key, value: attributes[key]});
                } else {
                    if (key == "useCase") {
                        settingsAttr.value[key] = attributes[key].useCase;
                    } else  settingsAttr.value[key] = attributes[key];
                }
            }
        }
        settingsAttr.value = JSON.stringify(settingsAttr.value);
        attributesArray.push(settingsAttr);
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }

    function saveRelations(entityId) {
        let relations = vm.addEntityFormGroup.get('relations').value;
        let tasks = [];
        for(let i=0; i < relations.length; i++) {
            let relation = {
                type: relations[i].relationType,
                typeGroup: 'COMMON'
            };
            if (relations[i].direction == 'FROM') {
                relation.to = relations[i].relatedEntity;
                relation.from = entityId;
            } else {
                relation.to = entityId;
                relation.from = relations[i].relatedEntity;
            }
            tasks.push(entityRelationService.saveRelation(relation));
        }
        if (tasks.length > 0) {
            return widgetContext.rxjs.forkJoin(tasks);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }

    vm.returnInputFields = function (fieldsArray) {
        return fieldsArray.filter(field=>field.type=="string" || field.type=="number");
    }

    vm.returnBooleanFields = function (fieldsArray) {
        return fieldsArray.filter(field=>field.type=="boolean");
    }

    vm.returnFunctionFields = function (fieldsArray) {
        return fieldsArray.filter(field=>field.type=="function");
    }

    vm.setFieldFormValue = function (value, field) {
         vm.addEntityFormGroup.controls.attributes.controls[field.name].setValue(value);
         vm.addEntityFormGroup.controls.attributes.controls[field.name].markAsDirty();
    }
}

