}

function EditEntityDialogController(instance) {
    let vm = instance;

    vm.entityName = entityName;
    vm.entityType = entityId.entityType;

    vm.editEntityFormGroup = vm.fb.group({
        parentAsset: [parentAsset.entityId, [vm.validators.required]],
    });

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };
    let utilityTaks = widgetContext.rxjs.of([]);

    entityRelationService.getRelation(parentAsset.entityId, "Utility", entityId, {ignoreErrors: true}).subscribe(resp=>{
        vm.utility = true;

    });

    vm.save = function() {
        if (vm.utility) {
           let newRelation = {
            from: vm.editEntityFormGroup.value.parentAsset,
            to: entityId,
            type: "Utility",
            typeGroup: "COMMON"

        };
        utilityTaks = widgetContext.rxjs.forkJoin([
        entityRelationService.saveRelation(newRelation),
        entityRelationService.deleteRelation(parentAsset.entityId, "Utility", entityId)
        ]) 
        } 
        vm.editEntityFormGroup.markAsPristine();
        let newRelation = {
            from: vm.editEntityFormGroup.value.parentAsset,
            to: entityId,
            type: "Contains",
            typeGroup: "COMMON"

        };
        widgetContext.rxjs.forkJoin([
        entityRelationService.saveRelation(newRelation),
        entityRelationService.deleteRelation(parentAsset.entityId, "Contains", entityId),
        utilityTaks
        ]).subscribe(
            function () {
                let aliases = [];
                        if(widgetContext.datasources && widgetContext.datasources.length) {
                            let aliasName = widgetContext.datasources[0].aliasName;
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                                if (value.alias === aliasName) {
                                    aliases.push(key);
                                }
                            }
                            widgetContext.updateAliases(aliases);
                        }
                vm.dialogRef.close(null);
            }
        );
    };

}

let $injector = widgetContext.$scope.$injector;
let dialogs = $injector.get(widgetContext.servicesMap.get(
    'dialogs'));
