    .servicesMap.get('entityRelationService'));
let parentAsset = widgetContext.stateController
    .getStateParams().selected_sub_asset;
    let utility = false;
if (parentAsset) openDeleteEntityDialog();

function openDeleteEntityDialog() {
    entityRelationService.getRelation(parentAsset.entityId,
        "Utility", entityId, {
            ignoreErrors: true
        }).subscribe(resp => {
        utility = true;
    });
    let title = 'Delete connection for the' + entityId.entityType
        .toLowerCase() + ' ' +
        entityName;
    let content =
        'Are you sure you want to delete connection for the ' +
        entityId.entityType.toLowerCase() + ' ' +
        entityName + '?';
    dialogs.confirm(title, content, 'Cancel', 'Delete')
        .subscribe(
            function(result) {
                if (result) {
                    deleteEntity();
                }
            }
        );
}

function deleteEntityObservable(entityId) {
    let tasks = [
        entityRelationService.deleteRelation(parentAsset
            .entityId, "Contains", entityId)
    ];
    if (utility) {
        tasks.push(entityRelationService.deleteRelation(parentAsset
            .entityId, "Utility", entityId, {
                ignoreErrors: true
            }));
    }
    return entityRelationService.deleteRelation(parentAsset
            .entityId, "Contains", entityId);
}

function deleteEntity() {
    deleteEntityObservable(entityId).subscribe(
        function success() {
            let aliases = [];
            if (widgetContext.datasources &&
                widgetContext.datasources.length) {
                let aliasName = widgetContext
                    .datasources[0].aliasName;
                for (const [key, value] of Object
                    .entries(widgetContext.dashboard
                        .aliasController.entityAliases)
                    ) {
                    if (value.alias === aliasName) {
                        aliases.push(key);
                    }
                }
                widgetContext.updateAliases(aliases);
            }
        },
        function fail() {
            showErrorDialog();
        }
    );
}



function showErrorDialog() {
    let title = 'Error';
    let content =
        'An error occurred while deleting the relations. Please try again.';
    dialogs.alert(title, content, 'CLOSE').subscribe(
        function(result) {}
    );
}

