headerButton.customFunction:
let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));
let assetService = $injector.get(widgetContext.servicesMap.get('assetService'));
let attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));
let entityRelationService = $injector.get(widgetContext.servicesMap.get('entityRelationService'));
let selectedParent = widgetContext.stateController.getStateParams().selected_asset;
openAddEntityDialog();

function openAddEntityDialog() {
    customDialog.customDialog(htmlTemplate, AddEntityDialogController).subscribe();
}

function AddEntityDialogController(instance) {
    let vm = instance;

    vm.allowedEntityTypes = ['ASSET'];
    vm.entitySearchDirection = {
        from: "FROM",
        to: "TO"
    }
    vm.customAttributes = [];
    vm.attributes = {};

    vm.addEntityFormGroup = vm.fb.group({
     entityName: ['', [vm.validators.required]],
     entityType: ['ASSET'],
     entityLabel: [null],
     type: ['', [vm.validators.required]],
     attributes: vm.fb.group({
         address: [null],
         imgPlan: [null],
         operatingHours: vm.fb.group({
             startTime: [null],
             endTime: [null]
         }),
         customAttributes: vm.fb.array([]),
     }),
     relations: vm.fb.array([])
    });


     vm.getAttrArray = function () {
        return vm.addEntityFormGroup.get("attributes.customAttributes");
    };
    vm.addIndividualAttr = function (el) {
        vm.getAttrArray().push(vm.fb.group({
            keyName: [el? el.keyName : null , [vm.validators.required]],
            keyValue: [el? el.keyValue : null, [vm.validators.required]]
        }));
    };
    vm.removeIndividualAttr = function (index) {
        vm.getAttrArray().removeAt(index);
    };
    function getEntityAttributes(attributes) {
        for (var i = 0; i < attributes.length; i++) {
            vm.attributes[attributes[i].key] = attributes[i].value;
        }
    }
    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    vm.relations = function() {
        return vm.addEntityFormGroup.get('relations');
    };

    if (selectedParent) {
        vm.selectedParent = selectedParent;
        vm.relations().push(vm.fb.group({
         relatedEntity: [selectedParent.entityId, [vm.validators.required]],
         relationType: ["Hierarchy", [vm.validators.required]],
         direction: [vm.entitySearchDirection.to, [vm.validators.required]]
        }));
    } else {
        vm.addEntityFormGroup.patchValue({
            type: "Hierarchy Level 1"
        });
    }

    vm.addRelation = function() {
        vm.relations().push(vm.fb.group({
         relatedEntity: [null, [vm.validators.required]],
         relationType: [null, [vm.validators.required]],
         direction: [null, [vm.validators.required]]
        }));
    };

    vm.removeRelation = function(index) {
        vm.relations().removeAt(index);
        vm.relations().markAsDirty();
    };

    vm.save = function() {
        vm.addEntityFormGroup.markAsPristine();
        saveEntityObservable().subscribe(
            function (entity) {
                widgetContext.rxjs.forkJoin([
                    saveAttributes(entity.id),
                    saveRelations(entity.id)
                ]).subscribe(
                    function () {
                            let query = {
                                parameters: {
                                    rootId: entity.id.id,
                                    rootType: entity.id.entityType,
                                    direction: "FROM",
                                    relationTypeGroup: "COMMON",
                                    maxLevel: 10
                                },
                                filters: [{ 
                                    relationType: "Hierarchy",
                                    entityTypes: ["ASSET"]
                                }]
                            };
                            entityRelationService.findByQuery(query).subscribe(resp=>{
                     vm.operatingHoursEntities = resp.map(el=>el.to);
                     let operatingHours = vm.addEntityFormGroup.get("attributes.operatingHours").value;
                     let utcValue = {};
                     let startTime = new Date(operatingHours.startTime);
                     utcValue.startTime =  new Date(Date.UTC(startTime.getFullYear(), startTime.getMonth(), startTime.getDate(), startTime.getHours(), startTime.getMinutes(), startTime.getSeconds(), startTime.getMilliseconds()));
                     let endTime = new Date(operatingHours.endTime);
                     utcValue.endTime =  new Date(Date.UTC(endTime.getFullYear(), endTime.getMonth(), endTime.getDate(), endTime.getHours(), endTime.getMinutes(), endTime.getSeconds(), endTime.getMilliseconds()));
                     let operatingHoursTasks = [];
                     vm.operatingHoursEntities.forEach(hEntity=>{
                         operatingHoursTasks.push(attributeService.saveEntityAttributes(hEntity, "SERVER_SCOPE", [{
                                 key: 'operatingHours',
                                 value: utcValue
                            }]
                        ));
                    });
                    widgetContext.rxjs.forkJoin(operatingHoursTasks).subscribe(()=>{});
                });
                        let aliases = [];
                        if(widgetContext.datasources && widgetContext.datasources.length) {
                            let aliasName = widgetContext.datasources[0].aliasName;
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                                if (value.alias === aliasName) {
                                    aliases.push(key);
                                }
                            }
                            widgetContext.updateAliases(aliases);
                        } else {
                            for (const [key, value] of Object.entries(widgetContext.dashboard.aliasController.entityAliases)) {
                            if (value.alias === "Hierarchy Devices") {
                                widgetContext.updateAliases([value.id]);
                            }
                        }
                        }
                        vm.dialogRef.close(null);
                    }
                );
            }
        );
    };

    function saveEntityObservable() {
        const formValues = vm.addEntityFormGroup.value;
        let entity = {
            name: formValues.entityName,
            type: formValues.type,
            label: formValues.entityLabel
        };
        if (formValues.entityType == 'ASSET') {
            return assetService.saveAsset(entity);
        } else if (formValues.entityType == 'DEVICE') {
            return deviceService.saveDevice(entity);
        }
    }

    function saveAttributes(entityId) {
        let attributes = vm.addEntityFormGroup.get('attributes').value;
        let attributesArray = [];
        for (let key in attributes) {
            if(attributes[key] !== null && key !== "customAttributes") {
                if (key === "operatingHours") {
                    let utcValue = {};
                     let startTime = new Date(attributes[key].startTime);
                     utcValue.startTime =  new Date(Date.UTC(startTime.getFullYear(), startTime.getMonth(), startTime.getDate(), startTime.getHours(), startTime.getMinutes(), startTime.getSeconds(), startTime.getMilliseconds()));
                     let endTime = new Date(attributes[key].endTime);
                     utcValue.endTime =  new Date(Date.UTC(endTime.getFullYear(), endTime.getMonth(), endTime.getDate(), endTime.getHours(), endTime.getMinutes(), endTime.getSeconds(), endTime.getMilliseconds()));
                     attributesArray.push({key: key, value: utcValue});
                } else attributesArray.push({key: key, value: attributes[key]});
            } else if (key === "customAttributes") {
                attributes[key].forEach(attr=>{
                    attributesArray.push({
                        key: attr.keyName,
                        value: attr.keyValue
                    });
                });
            }
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }

    function saveRelations(entityId) {
        let relations = vm.addEntityFormGroup.get('relations').value;
        let tasks = [];
        for(let i=0; i < relations.length; i++) {
            let relation = {
                type: relations[i].relationType,
                typeGroup: 'COMMON'
            };
            if (relations[i].direction == 'FROM') {
                relation.to = relations[i].relatedEntity;
                relation.from = entityId;
            } else {
                relation.to = entityId;
                relation.from = relations[i].relatedEntity;
            }
            tasks.push(entityRelationService.saveRelation(relation));
        }
        if (tasks.length > 0) {
            return widgetContext.rxjs.forkJoin(tasks);
        } else {
            return widgetContext.rxjs.of([]);
        }
    }
}

